import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import HomePage from './components/Welcome';
import PetPage from './components/Pet';
import ArticlesPage from './components/Articles';
import DetectPage from './components/Detection';
import EventsChart from './components/EventsChart';
import Search from './components/Search';
import ApiPanel from './components/ApiPanel';
import './styles/articles.css';
import './styles/detect.css';
import './styles/styles.css';
import './styles/sidebar.css';
import './styles/search.css';
import './styles/hello-page.css';
import './styles/header.css';


const App = () => {
    return (
        <Router>
            <div className="app-container">
                <Sidebar />
                <div className="main-content">
                    <Routes>
                        <Route path="/" element={<HomePage />} />
                        <Route path="/pet" element={<PetPage />} />
                        <Route path="/doc" element={<ArticlesPage />} />
                        <Route path="/detect" element={<DetectPage />} />
                        <Route path="/eventsChart" element={<EventsChart />} />
                        <Route path="/search" element={<Search />} />
                        <Route path="/api" element={<ApiPanel />} />
                    </Routes>
                </div>
            </div>
        </Router>
    );
};

export default App;
